import React from 'react';
import './Welcome.css';
import squashPicture from '../../assets/Ismail_N.jpg';

const Welcome = () => {
    return (
        <div className="welcome-section-main-container">
            <div className="welcome-section-container">
                <div className="welcome-header">
                    <div className="welcome-underline" />
                    <h1>About</h1>
                </div>
                <div className="welcome-container">
                    <img
                        src={squashPicture}
                        alt="Varsity Squash Headshot"
                    />
                    <p>
                        Hi! My name is Neel and I am a second year Computer Science student at the University of Waterloo.
                        I have experience in <strong>full-stack web and mobile development</strong> and am currently beginning to explore
                        <strong> artificial intelligence</strong> and <strong>blockchains</strong>. I love
                        tackling challenging problems and using software to build elegant, resilient, and innovative solutions.
                    </p>
                </div>
            </div>
        </div>
    )
}

export default Welcome;
